export default function Searchbar(){
  
  function searchHandler(e){
    e.preventDefault()

  }

  return(
    <div className="searchbar">
      <input type="search" placeholder="type something..."></input>
      <button onClick={searchHandler}>SEARCH</button>
    </div>
  )
}
